import React, { useEffect, useState } from 'react';
import axios from 'axios';
/* eslint-disable */
let itemConfig = null;
export default function ShowMenuItem(props) {
    const [posts, setPosts] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:3000/api/menu/item', { params: { menuItem: props.menuItem } })
            .then(res => {
                console.log(res.data);
                setPosts(res.data);
            });
    }), [];

    return (
    <div>{posts.map((m, key) =>
        <button className="btn btn-primary m-1">
            <input type="radio"/>{m.size1}
            <p>{m.size2}</p>
            <p>{m.size3}</p>
        </button>)}
    </div>);
}
